  "translationLines": [
    {
      "lineNumber": 173831,
      "originalJapaneseLine": "　主人は俺様だろう、違うか？　ア？」",
      "translatedEnglishLine": "The master is me, isn't that right? Huh?"
    },
    {
      "lineNumber": 173832,
      "originalJapaneseLine": "「んー……」",
      "translatedEnglishLine": "\"Hmm...\""
    },
    {
      "lineNumber": 173833,
      "originalJapaneseLine": "「ごめんね、ケイブリス様。",
      "translatedEnglishLine": "\"Sorry, Lord Cavebris."
    },
    {
      "lineNumber": 173834,
      "originalJapaneseLine": "　でもシャリエラのあるじはこっち」",
      "translatedEnglishLine": "But Shaliera’s master is me.\""
    },
    {
      "lineNumber": 173835,
      "originalJapaneseLine": "シャリエラがランスにくっつく。",
      "translatedEnglishLine": "Shaliera clings to Rance."
    },
    {
      "lineNumber": 173836,
      "originalJapaneseLine": "「がははは、モテる男は辛いぜ！」",
      "translatedEnglishLine": "\"Gahaha, being a popular man is tough!\""
    },
    {
      "lineNumber": 173837,
      "originalJapaneseLine": "「ガルティア……」",
      "translatedEnglishLine": "\"Gartia...\""
    },
    {
      "lineNumber": 173838,
      "originalJapaneseLine": "「悪いねぇ、大将。",
      "translatedEnglishLine": "\"Sorry, boss."
    },
    {
      "lineNumber": 173839,
      "originalJapaneseLine": "　これも巡り合わせと思ってくれ」",
      "translatedEnglishLine": "Just think of this as fate.\""
    },
    {
      "lineNumber": 173840,
      "originalJapaneseLine": "「テメェ、パイアールか……」",
      "translatedEnglishLine": "\"You... are Pyarl...?\""
    },
    {
      "lineNumber": 173841,
      "originalJapaneseLine": "「誤解しないでよ、ケイブリス。",
      "translatedEnglishLine": "\"Don't get me wrong, Cavebris."
    },
    {
      "lineNumber": 173842,
      "originalJapaneseLine": "　僕がこの男の味方なのは、",
      "translatedEnglishLine": "The reason I’m on this guy’s side"
    },
    {
      "lineNumber": 173843,
      "originalJapaneseLine": "　あくまでも姉さんの為だよ」",
      "translatedEnglishLine": "is solely for my sister’s sake.\""
    },
    {
      "lineNumber": 173844,
      "originalJapaneseLine": "「レイ……」",
      "translatedEnglishLine": "\"Rei...\""
    },
    {
      "lineNumber": 173845,
      "originalJapaneseLine": "「……ふんっ」",
      "translatedEnglishLine": "\"...Hmph.\""
    },
    {
      "lineNumber": 173846,
      "originalJapaneseLine": "「ケッセルリンク……だな？」",
      "translatedEnglishLine": "\"Kesselring... right?\""
    },
    {
      "lineNumber": 173847,
      "originalJapaneseLine": "「まったく奇妙なこととなった。",
      "translatedEnglishLine": "\"This has become quite strange indeed."
    },
    {
      "lineNumber": 173848,
      "originalJapaneseLine": "　だが、この互いの立ち位置が全てだ」",
      "translatedEnglishLine": "But this mutual positioning is everything.\""
    },
    {
      "lineNumber": 173849,
      "originalJapaneseLine": "「レキシントン……」",
      "translatedEnglishLine": "\"Lexington...\""
    },
    {
      "lineNumber": 173850,
      "originalJapaneseLine": "「こっ、怖い、けど……",
      "translatedEnglishLine": "\"Sc-scary, but..."
    },
    {
      "lineNumber": 173851,
      "originalJapaneseLine": "　ひ、退きません……」",
      "translatedEnglishLine": "I won’t back down...\""
    },
    {
      "lineNumber": 173852,
      "originalJapaneseLine": "「ワンニャン……テメェらまで、か……」",
      "translatedEnglishLine": "\"Wannyan... even you guys...?\""
    },
    {
      "lineNumber": 173853,
      "originalJapaneseLine": "「こ、これは違うにゃん！",
      "translatedEnglishLine": "\"Th-this is not what you think, nyan!"
    },
    {
      "lineNumber": 173854,
      "originalJapaneseLine": "　裏切ったわけじゃないにゃん！」",
      "translatedEnglishLine": "I didn’t betray you, nyan!\""
    },
    {
      "lineNumber": 173855,
      "originalJapaneseLine": "「そ、そうわん！",
      "translatedEnglishLine": "\"Y-yeah, that’s right, wan!"
    },
    {
      "lineNumber": 173856,
      "originalJapaneseLine": "　味方したくてしてるわけじゃ……」",
      "translatedEnglishLine": "I’m not siding with you because I want to...\""
    },
    {
      "lineNumber": 173857,
      "originalJapaneseLine": "「もういい、何も喋るな……」",
      "translatedEnglishLine": "\"Enough, don’t say another word...\""
    },
    {
      "lineNumber": 173858,
      "originalJapaneseLine": "「クク、ハハハハ……」",
      "translatedEnglishLine": "\"Kuku, hahahaha...\""
    },
    {
      "lineNumber": 173859,
      "originalJapaneseLine": "乾いた笑い声が漏れる――",
      "translatedEnglishLine": "A dry laugh escapes—"
    },
    {
      "lineNumber": 173860,
      "originalJapaneseLine": "それは誰もが初めて見る、",
      "translatedEnglishLine": "It was something no one had ever seen before,"
    },
    {
      "lineNumber": 173861,
      "originalJapaneseLine": "ケイブリスの感情を失った姿だった。",
      "translatedEnglishLine": "the emotionless form of Cavebris."
    },
    {
      "lineNumber": 173862,
      "originalJapaneseLine": "「人間はもちろんテメェの味方……",
      "translatedEnglishLine": "\"Humans, of course, are on your side..."
    },
    {
      "lineNumber": 173863,
      "originalJapaneseLine": "　魔人や悪魔までテメェの味方……",
      "translatedEnglishLine": "Even demons and devils are on your side..."
    },
    {
      "lineNumber": 173864,
      "originalJapaneseLine": "　俺様の部下や……召使いも……」",
      "translatedEnglishLine": "My subordinates... and servants too...\""
    },
    {
      "lineNumber": 173865,
      "originalJapaneseLine": "「そして、俺様の使徒まで……」",
      "translatedEnglishLine": "\"And even my apostles...\""
    },
    {
      "lineNumber": 173866,
      "originalJapaneseLine": "「対して、こっちは俺様……",
      "translatedEnglishLine": "\"Meanwhile, over here, I’m all alone...\""
    },
    {
      "lineNumber": 173867,
      "originalJapaneseLine": "　一人だけ……ってか？」",
      "translatedEnglishLine": "The only one... right?\""
    },
    {
      "lineNumber": 173868,
      "originalJapaneseLine": "「…………」",
      "translatedEnglishLine": "\"........\""
    },
    {
      "lineNumber": 173869,
      "originalJapaneseLine": "ケイブリスの怒りが、",
      "translatedEnglishLine": "Cavebris’ anger,"
    },
    {
      "lineNumber": 173870,
      "originalJapaneseLine": "一瞬の間を挟んで――爆発する。",
      "translatedEnglishLine": "after a brief pause — explodes."
    },
    {
      "lineNumber": 173871,
      "originalJapaneseLine": "「あああぁあああぁあああぁあぁぁぁあああ！」",
      "translatedEnglishLine": "\"Aaaahhhh!!!\""
    },
    {
      "lineNumber": 173872,
      "originalJapaneseLine": "「何故だ！　何故誰も俺様を愛さねえ！",
      "translatedEnglishLine": "\"Why!? Why does no one love me!?"
    },
    {
      "lineNumber": 173873,
      "originalJapaneseLine": "　俺様はこんなに頑張っているのに！」",
      "translatedEnglishLine": "I’m trying so hard!\""
    },
    {
      "lineNumber": 173874,
      "originalJapaneseLine": "「最強になれば誰からも愛されると思ったのに！」",
      "translatedEnglishLine": "\"I thought if I became the strongest, everyone would love me!\""
    },
    {
      "lineNumber": 173875,
      "originalJapaneseLine": "「何故！　何故だ！」",
      "translatedEnglishLine": "\"Why! Why!?\""
    },
    {
      "lineNumber": 173876,
      "originalJapaneseLine": "「がははは、俺様はお前と違って",
      "translatedEnglishLine": "\"Gahaha, unlike you,"
    },
    {
      "lineNumber": 173877,
      "originalJapaneseLine": "　人望があるから時間が経てば経つほど",
      "translatedEnglishLine": "I have charisma, so the more time passes,"
    },
    {
      "lineNumber": 173878,
      "originalJapaneseLine": "　仲間が増えて困っちまうぜ！」",
      "translatedEnglishLine": "the more comrades I get, it’s a problem for me!\""
    },
    {
      "lineNumber": 173879,
      "originalJapaneseLine": "「テメェらか！",
      "translatedEnglishLine": "\"Is it you guys!"
    },
    {
      "lineNumber": 173880,
      "originalJapaneseLine": "　テメェらが俺の邪魔をしてるのか！？」",
      "translatedEnglishLine": "You’re the ones interfering with me!?\""
    },
    {
      "lineNumber": 173881,
      "originalJapaneseLine": "「ふん、意味の分からんことを」",
      "translatedEnglishLine": "\"Hmph, such nonsense.\""
    },
    {
      "lineNumber": 173882,
      "originalJapaneseLine": "「ランス様……」",
      "translatedEnglishLine": "\"Lord Rance...\""
    },
    {
      "lineNumber": 173883,
      "originalJapaneseLine": "「情けない顔をするな、シィル」",
      "translatedEnglishLine": "\"Don’t make such a pathetic face, Seel.\""
    },
    {
      "lineNumber": 173884,
      "originalJapaneseLine": "「それよりその目でちゃんと見てろ。",
      "translatedEnglishLine": "\"More importantly, keep your eyes on this."
    },
    {
      "lineNumber": 173885,
      "originalJapaneseLine": "　俺様の大活躍をな」",
      "translatedEnglishLine": "Watch my great triumphs.\""
    },
    {
      "lineNumber": 173886,
      "originalJapaneseLine": "「は、はいっ」",
      "translatedEnglishLine": "\"Y-yes!\""
    },
    {
      "lineNumber": 173887,
      "originalJapaneseLine": "「そして、がはははははは！",
      "translatedEnglishLine": "\"And, gahahahaha!"
    },
    {
      "lineNumber": 173888,
      "originalJapaneseLine": "　俺様だけのハーレムを作るのだ！」",
      "translatedEnglishLine": "I will make a harem all for myself!\""
    },
    {
      "lineNumber": 173889,
      "originalJapaneseLine": "「あ、あう……」",
      "translatedEnglishLine": "\"Ah, aww...\""
    },
    {
      "lineNumber": 173890,
      "originalJapaneseLine": "「ああ、そうか、そうかよ……",
      "translatedEnglishLine": "\"Ah, I see, I see...\""
    }
  ]
}

